.cBreak-container {
    width: 40%;
    margin: 0 auto;
    display: inline-block;
}

.cBreak-container .cBreak {
    width: 100%;
    animation: flick 1s ease 1s, a 5s linear 1s infinite;
}

.right-animation {
    width: 20vh;
    display: inline-block;
    vertical-align: top;
    right: 0;
    transform: scaleX(-1);
    // margin-top: 10%;
    // margin-bottom: 10%;
}

@keyframes flick {
    0% {
        opacity: 1;
    }
    3% {
        opacity: 0;
        transform: skew(-35deg);
    }
    5% {
        opacity: 1;
        transform: skew(0deg);
    }
    100% {
        opacity: 1;
    }
}

@keyframes a {
    0% {
        opacity: 1;
    }
    1% {
        opacity: 0;
    }
    2% {
        opacity: 1;
    }
    49.5% {
        transform: skewX(0deg);
    }
    50% {
        transform: skewX(50deg);
    }
    50.5% {
        transform: skewX(0deg);
    }
    100% {
        opacity: 1;
        transform: skewX(0deg);
    }
}


