.hourglass-container {
    display: inline-block;
    width: 50%;
    position: relative;
    vertical-align: middle;
}

.hourglass1 {
    width: 100%;
    stroke-dasharray: 2000;
    stroke-dashoffset: 2000;
    stroke-width: 4;
    animation: dash 1.8s linear forwards 0.5s;
}

.hourglass {
    fill: rgba(0, 0, 0, 0);
    stroke: #2BBC94;
    stroke-miterlimit: 10;
}

@keyframes dash {
    10% {
        opacity: 1;
    }
    11% {
        opacity: 0;
    }
    12% {
        opacity: 1;
    }
    30% {
        opacity: 1;
    }
    41% {
        opacity: 0;
        transform: skew(0deg);
    }
    42% {
        opacity: 1;
        transform: skew(10deg);
    }
    43% {
        opacity: 1;
        transform: skew(0deg);
    }
    100% {
        stroke-dashoffset: 0;
        opacity: 0;
    }
}

.hourglass-container:after {
    content: "";
    height: 20px;
    width: 20px;
    border: 2px solid #2BBC94;
    margin-left: 10px;
    opacity: 0;
    position: absolute;
    left: -15px;
    top: -5px;
    animation: appear 0.5s ease 1s;
}

@keyframes appear {
    0% {
        opacity: 0;
    }
    50% {
        opacity: 1;
        box-shadow: 0px 0px 7px 2px #2BBC94;
    }
    100% {
        opacity: 0;
        box-shadow: 0px 0px 7px 2px #2BBC94;
    }
}


